const FooterWrapper = styled.footer`
  min-height: 5%;
  position: fixed;
`;

export const Footer = () => {
  return (
    <FooterWrapper className="fixed-bottom">

          <Col className="p-0 d-flex justify-content-end" md={3}>
            This site was made by Eduardo Mendoza.
          </Col>
    </FooterWrapper>
  );
};
